CREATE DEFINER=`root`@`localhost` PROCEDURE `add_student` (IN `p_class_id` INT, IN `p_user_username_or_email` VARCHAR(320))   BEGIN

	DECLARE v_is_username INT;
    DECLARE v_is_email INT;
    DECLARE v_user_id VARCHAR(320);
    
    SELECT COUNT(user_id) INTO v_is_username FROM users WHERE username = p_user_username_or_email;
    SELECT COUNT(user_id) INTO v_is_email FROM users WHERE email = p_user_username_or_email;
	
    IF v_is_username != 0 THEN
        SELECT user_id INTO v_user_id FROM users WHERE username = p_user_username_or_email;
    	INSERT INTO classes_students VALUES (p_class_id, v_user_id, NOW());
    END IF;
    
    IF v_is_email != 0 THEN
        SELECT user_id INTO v_user_id FROM users WHERE email = p_user_username_or_email;
    	INSERT INTO classes_students VALUES (p_class_id, v_user_id, NOW());
    END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `homework_add_class_students` (IN `p_class_id` INT, IN `p_hmk_id` VARCHAR(16), IN `p_problem_id` VARCHAR(20))   BEGIN

	DECLARE v_user_id VARCHAR(13);
    DECLARE done INT DEFAULT 0; 
    DECLARE cursor_users CURSOR FOR SELECT student_id FROM classes_students WHERE class_id = p_class_id;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;  
	DECLARE CONTINUE HANDLER FOR SQLSTATE '23000' SET done = 1;
    OPEN cursor_users;
    
    student_loop: LOOP
    	IF done = 1 THEN
        	leave student_loop;
        END IF;
      	FETCH cursor_users INTO v_user_id;
        
        INSERT INTO homeworks_problems_info VALUES 
        	(p_hmk_id, v_user_id, p_problem_id, 0, '', 'unsolved', -1, NOW());
        
    END LOOP student_loop;
    
    CLOSE cursor_users;
    

END$$

